data.text:
RT @Ar83312796: اب یہ ملک بچے گا یا یہ کرپٹ لوگ 
@ImranKhanPTI

#LetsReadyForMarch

@maia_drazhar @ConsumerSOS @DhkBeau Because I won’t do something I know causes people to feel insecure. 

My son was born on Canada day. We’ve had multitudes of flags for 21 years.  It’s just not worth flying it right now, when it’s been used by people who treat others so horribly. 

Maybe one day.
